import React from 'react';
import { useHistory, useLocation, useParams } from 'react-router-dom';

import Error from "./Error"

const Services = ()=>{
    const {link} = useParams();
    console.log(link)

    const add = useLocation();
    console.log(add)

    const his = useHistory();
    console.log(his)

    return (
        <>

                This is {link} Page. {add.pathname}
                {
                    ( add.pathname == "/contact" ? <> <Error id = { link }/> </> : null )
                }
                <button onClick = { ()=>{
                    his.goBack();
                } }> Go Back </button>
                <button onClick = { ()=>{
                    his.push("/home");
                } }> Go HOME </button>

        </>
    )
}

export default Services;
